     "id": 1,
     "name": "Super Tires",
     "description": "These tires are the very best",
     "inStock":5,
     "price": 50
  },
  {
     "id": 2,
     "name": "Reinforced Shocks",
     "description": "Shocks made from kryptonite",
     "inStock":4,
     "price": 120
  },
  {
     "id": 3,
     "name": "Padded Seats",
     "description": "Super soft seats for a smooth ride",
    "inStock":0,
    "price": 300
  }];

}
